import React from "react";
import earingBg from "../../img/bsu/earing-bg.jpg";

const Earing = () => {
  return (
    <div className="earing full-section">
      <div className="earing-wrapper col-12 col-xl-8">
        <h2 className="mb-5">Earning with BSU</h2>
        <p>
          Monetization from BSU comes from the running of nodes, with each
          verified transaction receiving BSU as a reward. Users can also trade
          their BSU memory for BTC.
        </p>
      </div>

      <img
        className="earing--background"
        src={earingBg}
        alt="earing background image"
      />
    </div>
  );
};

export default Earing;
